;; gorilla-repl.fileformat = 1

;; **
;;; # Using hough techniques to find lines and circles
;;; 
;;; Here we learn how to use opencv's hough lines  
;; **

;; @@
(ns opencv3.hough
  (:require
    [opencv3.utils :as u]
    [opencv3.colors.rgb :as color]
    [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Let's load the target image, and convert it to gray with a bit of blur, so that canny can work on it. 
;; **

;; @@
(def parking (-> "resources/images/lines/parking.png" imread (u/resize-by 0.3)))
(u/mat-view parking)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x49b3207 \"BufferedImage@49b3207: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 144 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def gray       (-> parking clone (cvt-color! COLOR_BGR2GRAY) (gaussian-blur! (new-size 3 3) 0 ) ))
(u/mat-view gray)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3f8e2180 \"BufferedImage@3f8e2180: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 144 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Edges detection is done using canny.
;; **

;; @@
(def edges      (-> gray clone (canny! 50 150 )))
(u/mat-view edges)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x46d2bf11 \"BufferedImage@46d2bf11: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 144 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Let's setup the parameters for the hough lines detection.
;; **

;; @@

(def rho 1) ; distance resolution in pixels of the Hough grid
(def theta  (/ Math/PI 180)) ;   angular resolution in radians of the Hough grid
(def min-intersections 15) ;   minimum number of votes (intersections in Hough grid cell)
(def min-line-length  50) ;   minimum number of pixels making up a line
(def max-line-gap  20 ) ;  maximum gap in pixels between connectable line segments

(def lines (new-mat))
(hough-lines-p edges lines rho theta min-intersections min-line-length max-line-gap)

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Now that we have the lines, let's draw them on a clone of the original picture.
;; **

;; @@
(def result (clone parking))
(dotimes [ i (.rows lines)]
(let [ val (.get lines i 0)]
  (line result
    (new-point (nth val 0) (nth val 1))
    (new-point (nth val 2) (nth val 3))
    color/teal
    2)))
(u/mat-view result)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"192\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x34b871b5 \"BufferedImage@34b871b5: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 192 height = 144 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Finally, output all the intermediate images used in this guide. Let's not forget that hconcat and vconcat need all the pictures to be in the same format, in our case, the same number of channels. We convert back *gray* and *edges* with the proper number of channels.
;; **

;; @@
(u/mat-view (hconcat! [
  parking
  (-> gray clone (cvt-color! COLOR_GRAY2RGB))
  (-> edges clone (cvt-color! COLOR_GRAY2RGB))
  result] ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"768\" height=\"144\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x77f39214 \"BufferedImage@77f39214: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 768 height = 144 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## Finding only pockets on a pool table
;; **

;; @@
(def pool 
  (-> 
    "https://raw.githubusercontent.com/badlogic/opencv-fun/master/data/topdown-6.jpg" 
    u/mat-from-url
    (u/resize-by 0.5)))
(u/mat-view pool)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"640\" height=\"360\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4b959dd4 \"BufferedImage@4b959dd4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 640 height = 360 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def gray (-> pool clone (cvt-color! COLOR_BGR2GRAY)))
(def minRadius 14)
(def maxRadius 18)
(def circles (new-mat))
(hough-circles gray circles CV_HOUGH_GRADIENT 1 minRadius 120 10 minRadius maxRadius)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def output (clone pool))
(dotimes [i (.cols circles)]
  (let [ circle (.get circles 0 i) x (nth circle 0) y (nth circle 1) r (nth circle 2)  p (new-point x y)]
  (opencv3.core/circle output p (int r) color/red-2 1)))
(u/mat-view output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"640\" height=\"360\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x16a49973 \"BufferedImage@16a49973: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 640 height = 360 #numDataElements 3 dataOff[0] = 2\"]"}
